import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { DashboardComponent } from './dashboard/dashboard.component';
import { UgandaPlaceDetailComponent } from './uganda-place-detail/uganda-place-detail.component';
import { UgandaPlaceSearchComponent } from './uganda-place-search/uganda-place-search.component';
import { UgandaPlacesComponent } from './uganda-places/uganda-places.component';
import { MessagesComponent } from './messages/messages.component';

@NgModule({
  declarations: [
    AppComponent,
    DashboardComponent,
    UgandaPlaceDetailComponent,
    UgandaPlaceSearchComponent,
    UgandaPlacesComponent,
    MessagesComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    For
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
